import React, { Component } from "react";
import axiosInstance from './axiosApi'
class Signup extends Component{
    constructor(props){
        super(props);
    }

    render() {
        return (
            <div>
                Signup
                <form onSubmit={this.props.SignupSubmit}>
                    <label>
                        Username:
                        <input name="username" type="text" value={this.props.SignupUsername} onChange={this.props.SignupChange}/>
                        { this.props.SignupErrors.SignupUsername ? this.props.SignupErrors.SignupUsername : null}
                    </label>
                    <label>
                        Username:
                        Email:
                        <input name="email" type="email" value={this.props.SignupEmail} onChange={this.props.SignupChange}/>
                        { this.props.SignupErrors.SignupEmail ? this.props.SignupErrors.SignupEmail : null}
                    </label>
                    <label>
                        Password:
                        <input name="password" type="password" value={this.props.SignupPassword} onChange={this.SignupChange}/>
                        { this.props.SignupErrors.SignupPassword ? this.props.SignupErrors.SignupPassword : null}
                    </label>
                    <input type="submit" value="Submit"/>
                </form>
            </div>
        )
    }
}
export default Signup;
